// Setup responsiveNav
var nav = responsiveNav(".nav-ul", { // Selector
 animate: true, // Boolean: Use CSS3 transitions, true or false
 transition: 284, // Integer: Speed of the transition, in milliseconds
 label: "Menu", // String: Label for the navigation toggle
 insert: "before", // String: Insert the toggle before or after the navigation
 customToggle: "", // Selector: Specify the ID of a custom toggle
 closeOnNavClick: false, // Boolean: Close the navigation when one of the links are clicked
 openPos: "relative", // String: Position of the opened nav, relative or static
 navClass: "nav-ul", // String: Default CSS class. If changed, you need to edit the CSS too!
 navActiveClass: "js-nav-active", // String: Class that is added to <html> element when nav is active
 jsClass: "js", // String: 'JS enabled' class which is added to <html> element
 init: function(){}, // Function: Init callback
 open: function(){}, // Function: Open callback
 close: function(){} // Function: Close callback
	});

$(document).ready(function () {
	
	// Wrap elements for styling purposes
	$('.button').wrapInner('<div class="button-inner">');
	$('.alert').wrapInner('<div class="alert-inner">');	

	// Dropdown navigation
	if (matchMedia("(min-width: 840px)").matches) {
		$('.nav-ul').superfish({
			delay:       1000,
			animation:   {height:'show'},
			speed:       300,
			dropShadows: false,
			autoArrows: 	false
		});
	}

	$(".owl-carousel").owlCarousel({
	 items : 1,
		singleItem : true,
		autoPlay : false,
		navigation : true,
		pagination : false,
		paginationNumbers : true,
		transitionStyle : "fadeUp", // fadeUp, backSlide, goDown
		autoHeight : true
	});
	
	// magnificPopup
	$('.popup').magnificPopup({type:'image'});

	$('.popup-gallery a').magnificPopup({ disableOn: 400, type:'image', gallery:{enabled:true} });

 // Datepicker
	$( ".datepicker-from, .datepicker-to" ).datepicker();
	
	// Navigation tabs
	$('.tabs').tabs();

	// Fluid width video embeds
 $(".wrapper").fitVids();
	
	// Activate lettering.js plugin for styling purposes
	$(".deals em, h1 em, .price").lettering();
	
	// Form validation in the contact form
	$(".form-contact").validate({
		errorElement: "em"
	});
	
	// Form validation in the availability form
	$(".form-availability").validate({
		errorElement: "em"
	});
	
	// Form validation in the newsletter form
	$(".form-newsletter").validate({
		errorElement: "em"
	});

});